import * as actionTypes from "./actionTypes";

export const authStart = () => {
    return {
        auth: actionTypes.AUTH_START,
    };
};

export const authSuccess = (authData) => {
    return {
        auth: actionTypes.AUTH_START,
        authData: authData,
    };
};

export const authFail = (error) => {
    return {
        auth: actionTypes.AUTH_START,
        error: error,
    };
};


export const auth = (email, password) => {
    return dispatch => {
        dispatch(authStart());
    }
}
